The angle between two lines with slopes $m_1$ and $m_2$ is given by the formula $\tan \theta = \left| \frac{m_1 - m_2}{1 + m_1 m_2} \right|$.
In this case, we have $m_1 = 2$ and $m_2 = \frac{1}{3}$, so the angle between the lines is $\tan \theta = \left| \frac{2 - \frac{1}{3}}{1 + 2 \cdot \frac{1}{3}} \right| = \left| \frac{\frac{5}{3}}{\frac{5}{3}} \right| = \boxed{\frac{1}{3}}$.
The answer is: \frac{1}{3}

